import React from 'react';
import ProjectImg from '../Assets/blogr-mobile.png';

class Projects extends React.Component {
  constructor(props){
    super(props)
  }
  render() {
    return (
      <div className="p-5 d-flex flex-row flex-wrap">
         <h1 className="block w-100">Gained Experience Building Projects</h1>
         <div className="d-flex flex-column mx-auto w-80 rounded-3 my-3" style={{maxWidth: 300, backgroundColor: '#FFFFFF', color:'#03045E'}}>
            <img src={ProjectImg} alt="Project Images" className="rounded-3"/>
            <p>Blogr Landing Page</p>
         </div>
         <div className="d-flex flex-column mx-auto w-80 rounded-3 my-3" style={{maxWidth: 300, backgroundColor: '#FFFFFF', color:'#03045E'}}>
            <img src={ProjectImg} alt="Project Images" className="rounded-3" />
            <p>Website</p>
         </div>
         <div className="d-flex flex-column mx-auto w-80 rounded-3 my-2" style={{maxWidth: 300, backgroundColor: '#FFFFFF', color:'#03045E'}}>
            <img src={ProjectImg} alt="Project Images" className="rounded-3" />
            <p>JavaScript</p>
         </div>
         <div className="d-flex flex-column mx-auto w-80 rounded-5 my-2" style={{maxWidth: 300, backgroundColor: '#FFFFFF', color:'#03045E'}}>
            <img src={ProjectImg} alt="Project Images" className="rounded-5" />
            <p>JavaScript</p>
         </div>
         <div className="d-flex flex-column mx-auto w-80 rounded-5 my-2" style={{maxWidth: 300, backgroundColor: '#FFFFFF', color:'#03045E'}}>
            <img src={ProjectImg} alt="Project Images" className="rounded-5" />
            <p>JavaScript</p>
         </div>
      </div>
    );
  }
}

export { Projects }
